import React from 'react';

const Frame4a21 = () => {
  return (
    <div
      style={{
        width: '366px',
        minHeight: '493px',
        display: 'flex',
        flexDirection: 'column',
        gap: '18px',
        boxSizing: 'border-box',
      }}
    >
      {/* Frame4a21 content goes here */}
      <div
        style={{
          width: '366px',
          height: '76px',
          fontFamily: 'Sora, sans-serif',
          fontWeight: 600,
          fontSize: '28px',
          lineHeight: '38px',
          letterSpacing: '-0.05em',
          color: 'rgba(22,17,13,1)',
          textTransform: 'capitalize',
          marginTop: '56px',
        }}
      >
        <span style={{ color: 'rgba(238,66,55,1)' }}>A new way to move goods</span> <span style={{ color: 'rgba(22,17,13,1)' }}>Tap. Track. Done.</span>
      </div>
      <hr
        style={{
          width: '366px',
          border: 'none',
          borderTop: '1px dashed rgba(22,17,13,1)',
          margin: '0 auto',
          height: 0,
        }}
      />
      <div
        style={{
          width: '366px',
          height: '168px',
          color: 'rgba(22,17,13,1)',
          fontFamily: 'Sora, sans-serif',
          fontWeight: 400,
          fontSize: '16px',
          lineHeight: '28px',
          letterSpacing: '-0.05em',
        }}
      >
        Book mini truck in seconds<br />
        Choose your pickup & drop location and<br />
        Select the desired vehicle.<br />
        Select the respected highly ranked<br />
        Transporters from our list<br />
        Weâ€™ll take care of the rest.
      </div>
    </div>
  );
};

export default Frame4a21;
